import React, { useEffect, useState } from "react";
import SplitPane, { Pane } from "react-split-pane";
import Answer from "../components/Answer";
import Question from "../components/Question";

import "./Problem.css";

const Problem = () => {
  const [loadedQuestions, setloadedQuestions] = useState([]);

  useEffect(() => {
    const allQuestions = {
      firstQuestionIndex: 2,
      questions: {
        1: {
          questionId: 1,
          level: "Easy",
          questionName: "sum",
          done: true,
          questionBody: "user gets two numbers and return the sum",
        },
        2: {
          questionId: 2,
          level: "Easy",
          questionName: "array sum",
          done: false,
          questionBody: "user gets arrayrs and return the sum",
        },
      },
    };

    setloadedQuestions(allQuestions);
  });

  return (
    <SplitPane split="vertical" minSize={20} defaultSize={700}>
      <Pane initialSize="150px">
        <Question
          questionName={loadedQuestions.questions[loadedQuestions.firstQuestionIndex].questionName}
          questionBody={loadedQuestions.questions[loadedQuestions.firstQuestionIndex].questionBody}
        />
      </Pane>
      <Pane initialSize="150px">
        <Answer />
      </Pane>
    </SplitPane>
  );
};

export default Problem;
